INSERT INTO `qt_article` VALUES ('5', '16', '121', '1', '新浪,新浪网,SINA,sina,sina.com.cn,新浪首页,门户,资讯', '新浪网为全球用户24小时提供全面及时的中文资讯，内容覆盖国内外突发新闻事件、体坛赛事、娱乐时尚、产业资讯、实用信息等，设有新闻、体育、娱乐、财经、科技、房产、汽车等30多个内容频道，同时开设博客、视频、论坛等自由互动交流空间。', '新浪', '新浪', '全球24小时全面及时的中文资讯', 'http://www.sina.com.cn', '新浪', '166', '0', '2018-05-10 16:08:00', '2018-11-30 10:26:49');
INSERT INTO `qt_article` VALUES ('6', '16', '11', '1', '网易,邮箱,游戏,新闻,体育,娱乐,女性,亚运,论坛,短信,数码,汽车,手机,财经,科技,相册', '网易是中国领先的互联网技术公司，为用户提供免费邮箱、游戏、搜索引擎服务，开设新闻、娱乐、体育等30多个内容频道，及博客、视频、论坛等互动交流，网聚人的力量。', '网易', '网易', '网聚人的力量', 'http://www.163.com', '网易', '133', '0', '2018-05-10 16:22:25', '2018-11-30 10:27:14');
INSERT INTO `qt_article` VALUES ('7', '16', '11', '1', '凤凰,凤凰网,凤凰新媒体,凤凰卫视,凤凰卫视中文台,资讯台,电影台,欧洲台,美洲台,凤凰周刊,phoenix,phoenixtv', '凤凰网是中国领先的综合门户网站，提供含文图音视频的全方位综合新闻资讯、深度访谈、观点评论、财经产品、互动应用、分享社区等服务，同时与凤凰无线、凤凰宽频形成三屏联动，为全球主流华人提供互联网、无线通信、电视网三网融合无缝衔接的新媒体优质体验。', '凤凰网', '凤凰网', '中国领先的综合门户网站', 'http://www.ifeng.com', '凤凰网', '134', '0', '2018-05-10 16:22:36', '2018-11-13 15:45:54');
INSERT INTO `qt_article` VALUES ('8', '16', '11', '1', '资讯,新闻,财经,房产,视频,NBA,科技,腾讯网,腾讯,QQ,Tencent', '腾讯网从2003年创立至今，已经成为集新闻信息，区域垂直生活服务、社会化媒体资讯和产品为一体的互联网媒体平台。腾讯网下设新闻、科技、财经、娱乐、体育、汽车、时尚等多个频道，充分满足用户对不同类型资讯的需求。同时专注不同领域内容，打造精品栏目，并顺应技术发展趋势，推出网络直播等创新形式，改变了用户获取资讯的方式和习惯。', '腾讯', '腾讯', '互联网媒体平台', 'http://www.qq.com', '腾讯', '135', '0', '2018-05-10 16:23:07', '2018-11-13 15:47:20');
INSERT INTO `qt_article` VALUES ('9', '16', '11', '1', '人民网,人民日报,中国共产党新闻,新闻中心,时政,社会,地方,地方领导,经济,能源环保,跨国公司,新农村,教育,科技,文化,饮食,娱乐,旅游,游戏,短信,彩信,资料,人民电视图片,直播,访谈,观点,理论,传媒,国际军事,台湾,港澳,汽车,房产,IT,家电,开发区,百强县,体育,奥运,彩票,健康,男士,生活,天气,光盘,数据,强国论坛,强国博客,人民微博', '人民网，是世界十大报纸之一《人民日报》建设的以新闻为主的大型网上信息发布平台，也是互联网上最大的中文和多语种新闻网站之一。作为国家重点新闻网站，人民网以新闻报道的权威性、及时性、多样性和评论性为特色，在网民中树立起了“权威媒体、大众网站”的形象。', '人民网', '人民网', '权威媒体、大众网站', 'http://www.peopledaily.com.cn/', '人民网', '136', '0', '2018-05-10 16:23:18', '2018-11-13 15:47:56');
INSERT INTO `qt_article` VALUES ('10', '17', '1', '1', '新闻中心,时政,人事任免,国际,地方,香港,台湾,澳门,华人,军事,图片,财经,政权,股票,房产,汽车,体育,奥运,法治,廉政,社会,科技,互联网,教育,文娱,电视剧,电影,视频,访谈,直播,专题', '中国主要重点新闻网站,依托新华社遍布全球的采编网络,记者遍布世界100多个国家和地区,地方频道分布全国31个省市自治区,每天24小时同时使用6种语言滚动发稿,权威、准确、及时播发国内外重要新闻和重大突发事件,受众覆盖200多个国家和地区,发展论坛是全球知名的中文论坛。', '新华网', '新华网', '让新闻离你更近', 'http://www.xinhuanet.com/', '新华网', '137', '0', '2018-05-10 16:23:31', '2018-11-13 15:48:25');
INSERT INTO `qt_article` VALUES ('11', '17', '11', '1', '中国网', '国家重点新闻网站，拥有十个语种独立新闻采编、报道和发布权；第一时间报道国家重大新闻事件；国情信息库服务全球读者了解中国；国务院新闻办公室发布会独家网络直播发布网站；拥有国内外顶级学者专家资源，独家编发各种相关政策解读。', '中国网', '中国网', '网上中国', 'http://www.china.com.cn/', '中国网', '138', '0', '2018-05-10 16:23:51', '2018-11-13 15:48:59');
INSERT INTO `qt_article` VALUES ('12', '17', '13', '1', '光明网,光明日报,时政,评论,理论,思想,学术,党建,经济,科技,教育,文化,娱乐,书画,旅游,摄影,卫生,法治,军事,体育,能源,汽车,电视,视频,访谈,动漫,传媒,社区,博客,百科,微博,云端读报,光明云媒,光明图片库,培训平台', '光明网是光明日报在网络时代的新延伸，也是国内唯一一家定位于思想理论领域的中央重点新闻网站。光明网坚持“可读、可信、可用”的办网原则，以“新闻视野、文化视角、思想深度、理论高度”为理念，努力打造“知识分子网上精神家园，权威思想理论文化网站”。', '光明网', '光明网', '知识分子网上精神家园', 'http://www.gmw.cn/', '光明网', '167', '0', '2018-05-10 16:24:04', '2018-11-14 14:08:47');
INSERT INTO `qt_article` VALUES ('13', '17', '12', '1', '环球网,环球时报,军事,国际新闻,兵器,国际军情,中国军力,网络调查,国际话题,视频新闻,最新消息,航母,全球化,舆情,网络评论,全球局势,全球动态,外交,中国外交,全球化,全球新闻,环球资讯,出国,留学,签证,胡锡进,钓鱼岛,三沙市,领土争端,huanqiu', '环球网是中国领先的国际资讯门户，拥有独立采编权的中央重点新闻网站。环球网秉承环球时报的国际视野，力求及时、客观、权威、独立地报道新闻，致力于应用前沿的互联网技术，为全球化时代的中国互联网用户提供与国际生活相关的资讯服务、互动社区。未来会致力于打造全球化在线生活平台，成为中国与国际之间沟通与交流的桥梁。', '环球网', '环球网', '全球生活新门户', 'http://www.huanqiu.com/', '环球网', '139', '0', '2018-05-10 16:24:16', '2018-11-13 15:50:28');
