INSERT INTO `qt_article` VALUES ('15', '17', '121', '1', '求是网,求是,红旗,求是杂志,红旗文稿,红旗文摘,理论网,qstheory,党刊,红旗,导读,原创精选,中国共产党,中国特色社会主义理论体系,理论学习,群众路线,两会,中国梦,普世价值,社会主义核心价值观,求是网评,旗帜,思想理论,中央机关刊,马工程,求是杂志社,习近平,十八大,马克思主义,毛泽东,邓小平,科学发展观', '求是网是中国共产党中央委员会机关刊《求是》杂志主办的理论宣传研究平台。求是网的目标定位是突出理论特色，既体现权威性、理论性、指导性，又体现时效性、开放性、互动性，发挥权威理论网站的引导、整合、服务功能，努力建设成为广大干部群众和理论工作者的理论宣传平台、思想激荡平台、学习交流平台、文献检索平台。', '求是网', '求是网', '思想建党 理论强党', 'http://www.qstheory.cn/', '求是网', '140', '0', '2018-05-11 17:07:32', '2018-11-14 11:54:19');
