INSERT INTO `qt_article` VALUES ('236', '35', '0', '1', '国家图书馆,国家古籍保护中心,国家典籍博物馆', '国家图书馆是国家总书库，国家书目中心，国家古籍保护中心，国家典籍博物馆。履行国内外图书文献收藏和保护的职责，指导协调全国文献保护工作；为中央和国家领导机关、社会各界及公众提供文献信息和参考咨询服务;开展图书馆学理论与图书馆事业发展研究，指导全国图书馆业务工作；对外履行有关文化交流职能，参加国际图联及相关国际组织，开展与国内外图书馆的交流与合作。', '国家图书馆是国家总书库，国家书目中心，国家古籍保护中心，国家典籍博物馆。履行国内外图书文献收藏和保护的职责，指导协调全国文献保护工作；为中央和国家领导机关、社会各界及公众提供文献信息和参考咨询服务;开展图书馆学理论与图书馆事业发展研究，指导全国图书馆业务工作；对外履行有关文化交流职能，参加国际图联及相关国际组织，开展与国内外图书馆的交流与合作。', '中国国家图书馆', '中国国家数字图书馆', 'http://www.nlc.gov.cn/', '', '371', '0', '2018-11-30 17:32:52', '0000-00-00 00:00:00');
