INSERT INTO `qt_article` VALUES ('239', '35', '0', '1', '首都图书馆,', '首都图书馆首都图书馆由北京市建筑设计研究院设计，是北京市市属综合性大型公共图书馆。它位于朝阳区华威桥东南侧，建筑面积3．7万平方米，高度49米，地上8层，共有17个阅览室，1000余个阅览座位，设计藏书量400万册。首都图书馆的建筑造型借鉴了中国的传统文化，又具有新的内涵。它平面取1／4扇型，围合着中心广场，形成强烈的聚合力，正立面恰似展开的长卷，立面中央则为巨大的牌楼造型，颇具视觉冲击力。', '首都图书馆首都图书馆由北京市建筑设计研究院设计，是北京市市属综合性大型公共图书馆。它位于朝阳区华威桥东南侧，建筑面积3．7万平方米，高度49米，地上8层，共有17个阅览室，1000余个阅览座位，设计藏书量400万册。首都图书馆的建筑造型借鉴了中国的传统文化，又具有新的内涵。它平面取1／4扇型，围合着中心广场，形成强烈的聚合力，正立面恰似展开的长卷，立面中央则为巨大的牌楼造型，颇具视觉冲击力。', '首都图书馆', '北京市市属综合性大型公共图书馆', 'http://www.clcn.net.cn/', '', '375', '0', '2018-11-30 17:38:31', '0000-00-00 00:00:00');
