INSERT INTO `qt_article` VALUES ('311', '19', '0', '1', '科学, 科学论坛, 科学博客，科学电子杂志,科学时报，科技，科教，教育,科学家', '科学网是由中国科学院、中国工程院和国家自然科学基金委员会主管，中国科学报社主办的综合性科学网站，主要为网民提供快捷权威的科学新闻报道、丰富实用的科学信息服务以及交流互动的网络平台，目标是建成最具影响力的全球华人科学社区。', '科学网是由中国科学院、中国工程院和国家自然科学基金委员会主管，中国科学报社主办的综合性科学网站，主要为网民提供快捷权威的科学新闻报道、丰富实用的科学信息服务以及交流互动的网络平台，目标是建成最具影响力的全球华人科学社区。', '科学网', '构建全球华人科学社区', 'http://www.sciencenet.cn/', '', '1478', '0', '2018-12-10 10:56:35', '0000-00-00 00:00:00');
INSERT INTO `qt_article` VALUES ('312', '19', '0', '1', '科学,探索,发现,天文,太空,航天,地球,自然,地理,环保,生态,人文,历史,考古,艺术,生命,医学,人类,动物,科普,科技,science,kexue,科学网', '中国科学网为中文用户提供全面及时的科学科普资讯，致力于发现人类未知，探索世界真相，保护地球生态，破解历史谜团等，设有天文太空、自然地理、环境保护、历史考古、生命医学、动物世界、科技生活等内容频道，同时开设论坛、家园、百科等互动交流服务，打造最具影响力的中文科学科普门户。', '中国科学网为中文用户提供全面及时的科学科普资讯，致力于发现人类未知，探索世界真相，保护地球生态，破解历史谜团等，设有天文太空、自然地理、环境保护、历史考古、生命医学、动物世界、科技生活等内容频道，同时开设论坛、家园、百科等互动交流服务，打造最具影响力的中文科学科普门户。', '中国科学网', '第一中文科学科普门户', 'http://www.minimouse.com.cn/', '', '1545', '0', '2018-12-10 11:00:27', '0000-00-00 00:00:00');
