INSERT INTO `qt_article` VALUES ('818', '124', '0', '1', '南风窗,南风窗网首页,南风窗网主页,南风窗杂志,南风窗官网,南风窗网站,南风窗网官方网站,城市,专栏,思想与文化,对话,人物,全球思想家,中国与世界,经济,调查与记录,公共政策,时局,纵论,封面报道', '南风窗网,南风窗杂志创刊于1985年,总部位于广州,隶属于中国第一大报业集团——广州日报报业集团。双周出版,读者以政府机关和学术机构的中坚力量最为集中,是中国发行量最大的政经新闻杂志,以其公允而独立的叙事立场深得人心,在政治、经济及思想学术领域具有广泛阅知率, 被外界誉为“中国政经第一刊”。美国《时代》周刊称《南风窗》为“一份属于中国高级知识分子的时事刊物”。BBC、NHK等国际媒体亦曾派出摄制组对工作中的本刊记者跟进拍摄,以纪录他们作为不可忽视的一种舆论力量的存在。', '南风窗网,南风窗杂志创刊于1985年,总部位于广州,隶属于中国第一大报业集团——广州日报报业集团。双周出版,读者以政府机关和学术机构的中坚力量最为集中,是中国发行量最大的政经新闻杂志,以其公允而独立的叙事立场深得人心,在政治、经济及思想学术领域具有广泛阅知率, 被外界誉为“中国政经第一刊”。美国《时代》周刊称《南风窗》为“一份属于中国高级知识分子的时事刊物”。BBC、NHK等国际媒体亦曾派出摄制组对工作中的本刊记者跟进拍摄,以纪录他们作为不可忽视的一种舆论力量的存在。', '南风窗网', '高级知识分子的时事刊物', 'http://www.nfcmag.com/', '', '1194', '0', '2019-02-11 15:30:39', '0000-00-00 00:00:00');
