INSERT INTO `qt_article` VALUES ('1063', '177', '0', '1', '壹基金', '壹基金是李连杰先生2007年4月创立的创新型公益组织，2011年1月作为中国第一家民间公募基金会落户深圳。壹基金以“尽我所能，人人公益”为愿景，搭建专业透明的公益平台，专注于灾害救助、儿童关怀与发展、公益支持与创新三大领域，致力于成为中国公益的开拓者、创新者和推动者。', '壹基金是李连杰先生2007年4月创立的创新型公益组织，2011年1月作为中国第一家民间公募基金会落户深圳。壹基金以“尽我所能，人人公益”为愿景，搭建专业透明的公益平台，专注于灾害救助、儿童关怀与发展、公益支持与创新三大领域，致力于成为中国公益的开拓者、创新者和推动者。', '壹基金', '壹基金官方网站', 'http://www.onefoundation.cn/', '', '1528', '0', '2019-03-04 10:52:44', '0000-00-00 00:00:00');
INSERT INTO `qt_article` VALUES ('1064', '177', '0', '1', '中国社会福利基金会', '中国社会福利基金会是由民政部登记和主管的全国性公募基金会，成立于2005年6月14日，原名中国社会福利教育基金会，2011年7月15日经民政部批准更名为“中国社会福利基金会”。中国社会福利基金会在民政部有关司局、社会爱心企业和爱心人士的大力支持和帮助下，募集善款规模逐年增长，事业得到长足发展。', '中国社会福利基金会是由民政部登记和主管的全国性公募基金会，成立于2005年6月14日，原名中国社会福利教育基金会，2011年7月15日经民政部批准更名为“中国社会福利基金会”。中国社会福利基金会在民政部有关司局、社会爱心企业和爱心人士的大力支持和帮助下，募集善款规模逐年增长，事业得到长足发展。', '中国社会福利基金会', '全国性公募基金会', 'http://www.cswef.org/', '', '1530', '0', '2019-03-04 13:35:01', '2019-03-04 13:35:22');
INSERT INTO `qt_article` VALUES ('1065', '171', '0', '1', '中华慈善总会,慈善,公益,爱心', '中华慈善总会成立于1994年，是经中国政府批准依法注册登记，由热心慈善事业的公民、法人及其他社会组织志愿参加的全国性非营利公益社会团体，目前在全国拥有333个会员单位。', '中华慈善总会成立于1994年，是经中国政府批准依法注册登记，由热心慈善事业的公民、法人及其他社会组织志愿参加的全国性非营利公益社会团体，目前在全国拥有333个会员单位。', '中华慈善总会', '全国性非营利公益社会团体', 'http://www.chinacharityfederation.org/', '', '1531', '0', '2019-03-04 13:36:14', '0000-00-00 00:00:00');
INSERT INTO `qt_article` VALUES ('1066', '177', '0', '1', '中国华侨公益基金会', '  “中国华侨公益基金会”是由中国侨联发起，经国家民政部批准成立的全国性公募基金会，独立的基金会法人，是对侨界及国内外企业、个人捐赠资金进行管理的民间非营利性组织。', '  “中国华侨公益基金会”是由中国侨联发起，经国家民政部批准成立的全国性公募基金会，独立的基金会法人，是对侨界及国内外企业、个人捐赠资金进行管理的民间非营利性组织。', '中国华侨公益基金会', '全国性公募基金会', 'http://www.qlgy.org/', '', '1533', '0', '2019-03-04 13:37:26', '2019-03-04 13:37:49');
