INSERT INTO `qt_article` VALUES ('1744', '335', '0', '1', '西藏,西藏新闻,西藏新闻网,中国西藏新闻网,西藏政务,西藏旅游,视觉周刊,藏语,藏语新闻,拉萨,林芝,山南,日喀则,那曲,阿里,昌都。', '汇聚西藏新闻，聚焦西藏政务，服务西藏人民。中国西藏新闻网是由西藏自治区党委宣传部主管，西藏日报社主办，并经国务院批复成立的西藏第一家省级重点新闻门户网站。网站于2002年10月1日正式开通上线，现已成为西藏自治区影响力最大的新闻门户网站，也是世界各地获取西藏信息的第一权威网络新闻来源，目前有关西藏的新闻80%以上来源于本网。', '汇聚西藏新闻，聚焦西藏政务，服务西藏人民。中国西藏新闻网是由西藏自治区党委宣传部主管，西藏日报社主办，并经国务院批复成立的西藏第一家省级重点新闻门户网站。网站于2002年10月1日正式开通上线，现已成为西藏自治区影响力最大的新闻门户网站，也是世界各地获取西藏信息的第一权威网络新闻来源，目前有关西藏的新闻80%以上来源于本网。', '中国西藏新闻网', '汇聚西藏新闻', 'http://www.chinatibetnews.com/', '', '2523', '0', '2019-06-26 08:18:41', '2019-06-26 08:19:04');
