INSERT INTO `qt_article` VALUES ('1787', '114', '0', '1', '帮众体育,赛事分析预测', '帮众体育依托足球篮球大数据，建立精准赛事分析模型，让赛事预测变得简单和高效；帮众体育致力于用数据技术为用户提供专业、详尽、准确的赛事分析预测解决方案。', '帮众体育依托足球篮球大数据，建立精准赛事分析模型，让赛事预测变得简单和高效；帮众体育致力于用数据技术为用户提供专业、详尽、准确的赛事分析预测解决方案。', '帮众体育', '让数据预测赛果，用技术改变生活', 'http://www.bzsports.com', '', '2589', '0', '2019-11-06 19:29:12', '0000-00-00 00:00:00');
