INSERT INTO `qt_taxonomy` VALUES ('18', '13', '文学', '1', '1', '文学,语言艺术', '文学是一种语言艺术，是话语蕴藉中的审美意识形态。诗歌、散文、小说、剧本、寓言、童话等不同体裁，是文学的重要表现形式。文学以不同的形式即体裁，表现内心情感，再现一定时期和一定地域的社会生活。作为学科门类理解的文学，包括中国语言文学、外国语言文学及新闻传播学。', '1', '0', '2018-11-28 17:23:41', '2018-12-04 15:53:05');
