INSERT INTO `qt_taxonomy` VALUES ('106', '13', '艺术', '1', '2', '造型艺术,表演艺术,综合艺术,语言艺术', '艺术体现和物化着人的一定审美观念、审美趣味与审美理想。无论艺术的审美创造抑或审美接受，都需要通过主体一定的感官去感受和传达并引发相应的审美经验。对艺术的审美分类，主要应根据主体的审美感受、知觉方式来进行。依据这个原则，艺术可以分为造型艺术、表演艺术、综合艺术和语言艺术四大类。', '1', '0', '2018-12-04 15:27:15', '2018-12-04 15:27:38');
INSERT INTO `qt_taxonomy` VALUES ('107', '106', '拍卖', '1', '3', '拍卖,古董', '拍卖(auction) 是专门从事拍卖业务的拍卖行接受货主的委托，在规定的时间与场所，按照一定的章程和规则，将要拍卖的货物向买主展示，公开叫价竞购，最后由拍卖人把货物卖给出价最高的买主的一种现货交易方式。', '2', '0', '2018-12-04 16:05:47', '2019-03-10 11:27:23');
INSERT INTO `qt_taxonomy` VALUES ('108', '39', '京剧', '1', '2', '京剧,中国国粹', '京剧，曾称平剧，中国五大戏曲剧种之一，场景布置注重写意，腔调以西皮、二黄为主，用胡琴和锣鼓等伴奏，被视为中国国粹，中国戏曲三鼎甲“榜首”。', '2', '0', '2018-12-05 16:22:57', '2018-12-05 16:25:54');
INSERT INTO `qt_taxonomy` VALUES ('109', '39', '戏曲', '1', '1', '戏曲,京剧,越剧,黄梅戏,评剧,豫剧', '中国的戏曲与希腊悲剧和喜剧、印度梵剧并称为世界三大古老的戏剧文化，经过长期的发展演变，逐步形成了以“京剧、越剧、黄梅戏、评剧、豫剧”五大戏曲剧种为核心的中华戏曲百花苑。', '2', '0', '2018-12-05 16:25:44', '0000-00-00 00:00:00');
INSERT INTO `qt_taxonomy` VALUES ('110', '39', '相声', '1', '3', '相声,说学逗唱', '相声（Crosstalk），一种民间说唱曲艺。它以说、学、逗、唱为形式，突出其特点。著名相声演员有张寿臣，马三立，侯宝林，刘宝瑞， 马季，侯耀文，苏文茂，郭德纲等。', '2', '0', '2018-12-05 16:26:56', '0000-00-00 00:00:00');
